#
# TABLE STRUCTURE FOR: day_tasks
#

DROP TABLE IF EXISTS `day_tasks`;

CREATE TABLE `day_tasks` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `purpose_id` bigint(20) unsigned NOT NULL,
  `day_task` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `mark_day_task` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `day_task_status` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `purpose_id` (`purpose_id`),
  CONSTRAINT `day_tasks_ibfk_1` FOREIGN KEY (`purpose_id`) REFERENCES `purposes` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



